import { useParams } from "react-router-dom";
import App from "./App";

function DogDetails() {
  const params = useParams();

  const dogArr = App.defaultProps.dogs;

  function dogRender() {
    dogArr.map((dog) => {
      if (params.name.toUpperCase() === dog.name.toUpperCase()) return dog.name;
    });
  }
  return <div>{dogRender}</div>;
}

export default DogDetails;
